// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenContract {
    address public owner;
    uint256 public maxTxAmount;
    uint256 public maxWalletSize;
    bool public transferDelayEnabled;

    event MaxTxAmountUpdated(uint256 newMaxTxAmount);

    constructor() {
        owner = msg.sender;
        maxTxAmount = 1000000; // Example initial value
        maxWalletSize = 1000000; // Example initial value
        transferDelayEnabled = false;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    function removeLimits() public onlyOwner {
        // Remove transaction and wallet limits
        maxTxAmount = type(uint256).max; // Set to maximum possible value
        maxWalletSize = type(uint256).max; // Set to maximum possible value
        transferDelayEnabled = false; // Disable transfer delay

        emit MaxTxAmountUpdated(maxTxAmount);
    }
}
```

### Explanation of Changes:
1. **Readability**: The original code was overly complex and contained redundant checks and variables. These were removed to simplify the logic.
2. **Variable Naming**: Replaced ambiguous variable names like `var_a`, `var_b`, etc., with meaningful names such as `maxTxAmount`, `maxWalletSize`, and `transferDelayEnabled`.
3. **Owner Check**: Added an `onlyOwner` modifier to enforce the owner-only restriction in a clean and reusable way.
4. **Event**: Retained the `MaxTxAmountUpdated` event to notify when the transaction limit is updated.
5. **Constants**: Used `type(uint256).max` to represent the maximum possible value for `maxTxAmount` and `maxWalletSize`.
6. **Constructor**: Added a constructor to initialize the contract's state variables.
7. **Removed Redundant Code**: Removed unnecessary nested conditions and unused variables.

This refactored code is clean, functional, and adheres to Solidity best practices.

